const TodoList = ({todos, deleteToDo}) => {
return (
    <>
{todos?.length > 0 ? (
    <ul className='todolist'>
      {todos.map((todo, index) => (
        <div className="todo">
          <li key = {index}> {todo.task} </li>
          <button className='delete-button' onClick={() => {deleteToDo(todo)}}>Delete</button>
          <br />
        </div>
      ))}
    </ul>
    ) : (
      <div className='empty'>
        <p>No Task Found</p>
        </div>
    )}

    </>
);
      };
